通常情况下，你应该在十字路口进行召唤，以便出卖你的灵魂...
如果你想夺走魔鬼的灵魂，看起来你得在他自己的地盘上召唤他！

{Embed}TypeImage;rlcraft:textures/quests/rahovartaltar.png;100;100;256;256{Embed}

似乎要召唤更强大的生物，你需要从小处着手。或许你可以从那些遍布各地的大型恶魔地牢中屠杀首领开始！

或者，你可以利用那把钥匙和祭坛，亲自召唤出一个恶魔……

{Embed}TypeImage;rlcraft:textures/quests/ebonaltar.png;100;100;256;256{Embed}

如果你能用一个恶魔之魂与末影催化剂在炼狱召唤恶魔，那为何不尝试反向操作呢？
 不过，首先你得设法获得一个异变之魂...

{Embed}TypeImage;rlcraft:textures/quests/epionaltar.png;100;100;256;256{Embed}

看来那该死的龙把你们找到的末地岛上的能量都吸干了……
 或许在未开发的岛屿上召唤会有更好的运气。

